import React from 'react';
import './App.css';

function App() {
  // Initialize a 9x9 grid with all zeros
  const grid = Array(9).fill().map(() => Array(9).fill(0));

  const handleClick = (i, j) => {
    // Handle the click event here
    console.log(`You clicked row ${i + 1}, column ${j + 1}`);
  };

  return (
    <div className="App">
      <table className="center">
        <tbody>
          {grid.map((row, i) => (
            <tr key={i}>
              {row.map((value, j) => (
                <td key={j}>
                  <input type="text" value={value} onClick={() => handleClick(i, j)} readOnly />
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
